import React, { useState } from 'react';
import axios from 'axios';

const LoginForm: React.FC = () => {
  const [username, setUsername] = useState('17710831560');
  const [password, setPassword] = useState('D/Lm4fqE+9IIUpj0VO/J9A==');
  const [query, setQuery] = useState('');
  const [results, setResults] = useState([]);

  const handleLogin = async () => {
    var response;
    try {
        const formData = new URLSearchParams();
      formData.append('username', username);
      formData.append('password', password);
      formData.append('vCode', '');

      // 发送 POST 请求
      response = await axios.post(
        'https://wx.rocketbird.cn/Web/Public/check_login',
        formData,
        {
          headers: {
            'Content-Type': 'application/x-www-form-urlencoded',
            'Connection': 'keep-alive',
            'Accept-Encoding': 'gzip, deflate, br',
            'Accept': '*/*',
            'Origin': 'https://vip.rocketbird.cn',
          },
          withCredentials: true, // 允许携带跨域请求的cookie
        }
      );

      console.log('Login successful', response.headers);

    } catch (error) {
      console.error('Login error', response);
    }
  };

  const handleSearch = async () => {
    
    var parma={
        search:'',
        begin_date:'2024-06-1',
        end_date:'2024-06-13',
        page_no:1,
        page_size:0,
        type:'',
        pay_type:'',
        pay_status:'',
        related:'',
        bus_id:11536
    }
    try {
      const response = await axios.post('http://localhost:3001/api/search', {parma}, { withCredentials: false });
      setResults(response.data.results);
    } catch (error) {
      console.error('Search error', error);
    }
  };

  return (
    <div>
      <h1>Login</h1>
      <input type="text" placeholder="Username" value={username} onChange={(e) => setUsername(e.target.value)} />
      <input type="password" placeholder="Password" value={password} onChange={(e) => setPassword(e.target.value)} />
      <button onClick={handleLogin}>Login</button>
      
      <h1>Search</h1>
      <input type="text" placeholder="Search query" value={query} onChange={(e) => setQuery(e.target.value)} />
      <button onClick={handleSearch}>Search</button>

      <h2>Results</h2>
      <ul>
        {results.map((result, index) => (
          <li key={index}>{result}</li>
        ))}
      </ul>
    </div>
  );
};

export default LoginForm;
